import React from 'react';
import { Link } from 'react-router-dom';


const RegisterForm = () => {
  return(

    <div>
    <form>
    <input name="Name"></input>
    <input name="Email"></input>
    <input name="Password"></input>
    <button>Submit</button>
    </form>
    </div>
  );
}
